import gsap from "gsap";
import React, { useEffect, useLayoutEffect, useRef } from "react";
import { ScrollTrigger } from "gsap/ScrollTrigger";
gsap.registerPlugin(ScrollTrigger);
const Model = () => {
  const svgOne = useRef(null);
  const svgTwo = useRef(null);
  const svgThree = useRef(null);
  const svgFour = useRef(null);
  const svgFive = useRef(null);
  const svgSix = useRef(null);
  const svgSeven = useRef(null);
  const total = useRef(null);

  useEffect(() => {
    let t1 = gsap
      .timeline({
        scrollTrigger: {
          trigger: "#heroStart",
          start: "top+=50 top",
          end: "top-=50 top",
          endTrigger: "#heroAbout",
          scrub: 1,
          markers: true,
        },
      })
      .to(
        svgOne.current,
        {
          scale: 0.5,
          rotation: -90,
          transform: `translate(622.5px, 826px)`,
          // transform: `matrix(0.00117894, -0.500761, 0.500761, 0.00117894, 436.811, 449.558)`,
        },
        "key1"
      )
      .to(
        svgTwo.current,
        {
          scale: 0.5,
          rotation: -0.0409,
          transform: `translate(882.7px, 656px)`,
          // transform: `matrix(0.500369, 0.000355121, -0.000355121, 0.500369, 731.961, 542.887)`,
        },
        "key1"
      )
      .to(
        svgThree.current,
        {
          scale: 0.5,
          rotation: 0,
          transform: `translate(791.7px, 656px)`,
          // transform: `matrix(0.500295, 0, 0, 0.500295, 641.864, 542.849)`,
        },
        "key1"
      )
      .to(
        svgFour.current,
        {
          scale: 0.5,
          rotation: 179.7,
          transform: `translate(1247.7px, 825.7px)`,
          // transform: `matrix(-0.500368, -0.00112144, 0.00112144, -0.500368, 797.687, 486.404)`,
        },
        "key1"
      )
      .to(
        svgFive.current,
        {
          scale: 0.5,
          rotation: 90,
          transform: `translate(1416px, 734px)`,
          // transform: `matrix(1.98954e-05, 0.500018, -0.500018, 1.98954e-05, 1002.94, 658.171)`,
        },
        "key1"
      )
      .to(
        svgSix.current,
        {
          scale: 0.5,
          rotation: 180,
          transform: `translate(1065px, 658px)`,
          // transform: `matrix(-0.500324, -0.000672607, 0.000672607, -0.500324, 616.1, 316.482)`,
        },
        "key1"
      )
      .to(
        svgSeven.current,
        {
          scale: 0.5,
          rotation: 180,
          transform: `translate(1157px, 825.7px)`,
          // transform: `matrix(-0.500324, 0.000672607, -0.000672607, -0.500324, 706.865, 486.626)`,
        },
        "key1"
      );

    let t2 = gsap
      .timeline({
        scrollTrigger: {
          trigger: "#heroAbout",
          start: "top+=500 top",
          end: "top-=500 top",
          endTrigger: "#spaceSection",
          scrub: 1,
          markers: true,
        },
      })
      .to(
        svgOne.current,
        {
          scale: 0.5,
          rotation: 0,
          transform: `translate(792px, 656px)`,
          // transform: `matrix(0.5, 0, 0, 0.5, 650.676, 500.056)`,
          // transform: `translate(710px, 580px)`,
          display: "none",
          // zIndex: 100,
        },
        "key2"
      )
      .to(
        svgTwo.current,
        {
          scale: 0.5,
          rotation: 0,
          transform: `translate(791.8px, 656px)`,
          display: "none",
        },
        "key2"
      )
      .to(
        svgFive.current,
        {
          scale: 0.5,
          rotation: -0.067,
          transform: `translate(1156px, 655px)`,
        },
        "key2"
      )
      .to(
        svgSix.current,
        {
          scale: 0.5,
          rotation: 180,
          transform: `translate(1065px, 825px)`,
          // transform: `matrix(-0.500324, -0.000672607, 0.000672607, -0.500324, 616.1, 316.482)`,
        },
        "key2"
      )
      .to(
        svgSeven.current,
        {
          scale: 0.5,
          rotation: 180,
          transform: `translate(1247px, 825.5px)`,
        },
        "key2"
      );

    let t3 = gsap
      .timeline({
        scrollTrigger: {
          trigger: "#spaceSection",
          start: "top top",
          end: "bottom bottom",
          // endTrigger: "#spaceSection",
          scrub: 1,
          markers: true,
        },
      })
      .to(svgFive.current, {
        // width: "100vw",
        // height: "100vh",
        scale: 100,
        transform: `translate(1156px, 655px)`,
        rotation: 0,
        transformOrigin: "left center", // Set the transform origin to the center
        x: "50vw",
        y: "50vh",
      })
      .to(svgSix.current, {
        // scale: 100,
        // rotation: 180,
        // transform: `translate(1065px, 825px)`,
        // transform: `matrix(-0.500324, -0.000672607, 0.000672607, -0.500324, 616.1, 316.482)`,
      })
      .to(svgSeven.current, {
        // scale: 100,
        // rotation: 180,
        // transform: `translate(1247px, 825.5px)`,
      });
    return () => {
      if (t1) t1.kill();
      if (t2) t2.kill();
      if (t3) t3.kill();
    };
  }, []);

  return (
    <div className=".box" ref={total}>
      <svg
        xmlns="http://www.w3.org/2000/svg"
        viewBox="0 0 1440 860"
        // width="1440"
        height="860"
        preserveAspectRatio="xMidYMid meet"
        style={{
          width: "99.9%",
          height: "100%",
          transform: "translate3d(0px, 0px, 0px)",
          contentVisibility: "visible",
        }}
      >
        <defs>
          <clipPath id="__lottie_element_5">
            <rect width="1440" height="860" x="0" y="0"></rect>
          </clipPath>
        </defs>
        <g clip-path="url(#__lottie_element_5)">
          <g
            transform="matrix(0.999998, 0, 0, 0.999998, 598.352, 240.113)"
            opacity="1"
            ref={svgOne}
            style={{ display: "block" }}
          >
            <g
              opacity="1"
              transform="matrix(1,0,0,1,-207.8520050048828,-56.112998962402344)"
            >
              <path
                fill="rgb(20,20,20)"
                fill-opacity="1"
                d=" M91.5,-170 C91.5,-170 -91.5,-170 -91.5,-170 C-91.5,-170 -91.5,170 -91.5,170 C-91.5,170 91.5,170 91.5,170 C91.5,170 91.5,-170 91.5,-170z"
              ></path>
            </g>
          </g>
          <g
            transform="matrix(0.5446339249610901,0.8386627435684204,-0.8386627435684204,0.5446339249610901,272.4046936035156,388.20416259765625)"
            opacity="1"
            ref={svgTwo}
            style={{ display: "block" }}
          >
            <g
              opacity="1"
              transform="matrix(1,0,0,1,-207.8520050048828,-56.112998962402344)"
            >
              <path
                fill="rgb(20,20,20)"
